(164, 'my_options', 'a:21:{s:13:\"email_address\";s:14:\"info@gmail.com\";s:14:\"contact_number\";s:11:\"01865850477\";s:6:\"button\";s:17:\"Login/Reistration\";s:7:\"button1\";s:11:\"Get A Quote\";s:11:\"Our_product\";s:15:\"Our Steel Items\";s:19:\"Our_product_tagline\";s:499:\"HATIM Group of Industries Ltd. started its operation in 2000.Since its inception, the management of HATIM has always believed in endeavoring to provide the best comprehensive solutions to drinking water & sewage system. It also offers a comprehensive solution to a diverse range of clients, both in local and international markets..The brand “HATIM” is a popular name in Bangladesh for its products namely GI Pipes MS Pipes, SS Pipes, uPVC Pipes & Fittings, PPR Pipes & Fittings, HDPE Pipes etc.\";s:11:\"Chill_image\";s:90:\"http://localhost/wordpress/wp-content/uploads/2023/08/istockphoto-1341803072-612x612-1.jpg\";s:7:\"Product\";s:287:\"We would like to thank our clients, customers, partners, employees, and suppliers as we celebrate our 10th year anniversary! Thank you for supporting us these last few years and helping us to succeed! Do you have any good memories of the company. We decided our Group 22 Year Anniversary\";s:15:\"Product_tagline\";s:237:\"WHATIM Furniture is a sister company of a HATIM Group. Our furniture range includes sofa sets, beds, dining tables, T.V cabinets/units, cupboards, dressing tables, sofa cum beds, study tables, computer tables and lots more for your home.\";s:7:\"Service\";s:41:\"We provide quality solutions for clients.\";s:15:\"Service_tagline\";s:380:\"HATIM Group of Industries Ltd. started its operation in 2000.Since its inception, the management of HATIM has always believed in endeavoring to provide the best comprehensive solutions to drinking water & sewage system. It also offers a comprehensive solution to a diverse range of clients, both in local and international markets. We have both in local and international markets.\";s:12:\"Client_image\";s:66:\"http://localhost/wordpress/wp-content/uploads/2023/08/team-0-4.png\";s:6:\"Review\";s:332:\"HATIM Group of Industries Ltd. started its operation in 2000. Since its inception, the management of HATIM has always believed in endeavoring to provide the best comprehensive solutions to drinking water & sewage system. It also offers a comprehensive solution to a diverse range of clients, both in local and international markets.\";s:13:\"Reviewer_name\";s:12:\"Safayet Azad\";s:10:\"Cust_image\";s:76:\"http://localhost/wordpress/wp-content/uploads/2023/07/hatim-group-logo-4.jpg\";s:7:\"Project\";s:17:\"Our Happy Partner\";s:7:\"Factory\";s:12:\"Factory Look\";s:13:\"Factory_image\";s:76:\"http://localhost/wordpress/wp-content/uploads/2023/07/hatim-group-logo-3.jpg\";s:12:\"Footer_image\";s:69:\"http://localhost/wordpress/wp-content/uploads/2023/07/hatim-logo-.png\";s:6:\"Footer\";s:220:\"HATIM Group of Industries Ltd. started its operation in 2000. Since its inception, the management of Hatim has always believed in endeavoring to provide the best comprehensive solutions to drinking water & sewage system.\";s:8:\"Pg_image\";s:63:\"http://localhost/wordpress/wp-content/uploads/2023/08/pgw-1.jpg\";}', 'yes'),
