(62, 'woocommerce-shipping-fedex-api-outage-2023-07-16', 'warning', 'en_US', 'Scheduled FedEx API outage — July 2023', 'On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.', '{}', 'pending', 'woocommerce.com', '2023-07-27 09:30:59', NULL, 0, 'plain', '', 0, 0, 'info'),
(63, 'square_payments_q3_2023', 'marketing', 'en_US', 'Square for WooCommerce', 'Connect your Square account with WooCommerce to accept online and in-person payments (including contactless payments and cross-channel gift cards) quickly and securely. Save time by syncing sales, customers, and items and inventory — and manage everything through one centralized platform.', '{}', 'pending', 'woocommerce.com', '2023-07-27 09:30:59', NULL, 0, 'plain', '', 0, 0, 'info'),
(64, 'wcship-2023-07-hazmat-update-needed', 'update', 'en_US', 'Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension', '<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.', '{}', 'pending', 'woocommerce.com', '2023-07-27 09:30:59', NULL, 0, 'plain', '', 0, 0, 'info'),
(65, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Choosing a theme?', 'Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.', '{}', 'unactioned', 'woocommerce-admin', '2023-07-31 03:09:38', NULL, 0, 'plain', '', 0, 0, 'info'),
(66, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'How to customize your product catalog', 'You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.', '{}', 'unactioned', 'woocommerce-admin', '2023-07-31 03:09:38', NULL, 0, 'plain', '', 0, 0, 'info'),
(67, 'wc-admin-mobile-app', 'info', 'en_US', 'Install Woo mobile app', 'Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.', '{}', 'unactioned', 'woocommerce-admin', '2023-07-31 03:09:39', NULL, 0, 'plain', '', 0, 0, 'info'),
(68, 'wc-admin-woopayments-rebrand', 'marketing', 'en_US', 'WooCommerce Payments is now WooPayments', 'We’ve changed the name as part of recent updates to the Woo brand. You’ll still enjoy the same seamless payments experience — just look for WooPayments in your WordPress admin.', '{}', 'pending', 'woocommerce.com', '2023-07-31 03:09:52', NULL, 0, 'plain', '', 0, 0, 'info'),
(69, 'wc-admin-onboarding-payments-reminder', 'info', 'en_US', 'Start accepting payments on your store!', 'Take payments with the provider that’s right for you - choose from 100+ payment gateways for WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2023-08-01 08:37:05', NULL, 0, 'plain', '', 0, 0, 'info'),
(70, 'woocommerce-WCStripe-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe plugin', '<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-08-03 03:03:27', NULL, 0, 'plain', '', 0, 0, 'info'),
(71, 'woocommerce-WCStripe-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooCommerce Stripe plugin', '<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-08-03 03:03:27', NULL, 0, 'plain', '', 0, 0, 'info'),
(72, 'woocommerce-WooPayments-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooPayments (WooCommerce Payments) plugin', '<strong>Your shop requires an important security update for the WooPayments (WooCommerce Payments) extension</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-08-03 03:03:27', NULL, 0, 'plain', '', 0, 0, 'info'),
(73, 'woocommerce-WooPayments-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooPayments (WooCommerce Payments) plugin', '<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-08-03 03:03:27', NULL, 0, 'plain', '', 0, 0, 'info'),
(74, 'wc-admin-orders-milestone', 'info', 'en_US', 'First order received', 'Congratulations on getting your first order! Now is a great time to learn how to manage your orders.', '{\"current_milestone\":1}', 'unactioned', 'woocommerce-admin', '2023-08-03 05:37:07', NULL, 0, 'plain', '', 0, 0, 'info'),
(75, 'wc-admin-launch-checklist', 'info', 'en_US', 'Ready to launch your store?', 'To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.', '{}', 'unactioned', 'woocommerce-admin', '2023-08-03 10:27:33', NULL, 0, 'plain', '', 0, 0, 'info'),
(76, 'tiktok-apac-webinar-2023', 'marketing', 'en_US', 'Unlocking TikTok: Live Webinar August 9', 'Join us on August 9 for a free online masterclass with our partners at TikTok, tailored to Woo merchants in the APAC region (11 am AEST). You’ll learn how to connect your store to TikTok, unlock expert advertising tools, and reach its one billion active global users — all from the comfort of your own home.', '{}', 'pending', 'woocommerce.com', '2023-08-05 04:18:28', NULL, 0, 'plain', '', 0, 0, 'info');
